// Rent for visitor

import React, { useState, useEffect } from 'react';
import Axios from 'axios';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

function ProductSummary({ rental, isLoggedIn }) {
  const handleClick = () => {
    alert('Login required to view details.');
  };

  return (
    <Col key={rental.id} md={3}>
      <div onClick={handleClick} style={{ cursor: 'pointer', textDecoration: 'none' }}>
        <Card className="mb-4 shadow">
        <Card.Img src={rental.image} alt="Rental" style={{ height: '180px' }} />
          <Card.Body>
            <Card.Title style={{ color: 'darkblue' }} > {rental.model} </Card.Title>
            <Card.Text style={{ color: 'purple' }} > {rental.address} </Card.Text>
            <Card.Title style={{ color: 'brown' }}>
              BDT {rental.price}  (
              <span style={{ color: rental.is_available ? 'green' : 'red' }}>
                {rental.is_available ? 'Available' : 'Not Available'}
              </span>)
            </Card.Title>
          </Card.Body>
        </Card>
      </div>
    </Col>
  );
}

function VisitRent() {
  const [rentals, setRentals] = useState([]);

  useEffect(() => {
    document.title = 'Rent';
    Axios.get('http://127.0.0.1:8000/api/rentals/')
      .then((response) => {
        setRentals(response.data);
      })
      .catch((error) => {
        console.error('Error fetching rental data:', error);
      });
  }, []);

  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary" data-bs-theme="dark">
        <Container fluid>
          <Navbar.Brand href="http://localhost:3000/s/home">VehicleVerse</Navbar.Brand>
          <Navbar.Toggle aria-controls="vehicleverse" />
          <Navbar.Collapse id="vehicleverse">
            <Nav className="me-auto my-2 my-lg-0" style={{ maxHeight: '100px' }}>
              <Nav.Link href="http://localhost:3000/s/home">Home</Nav.Link>
              <Nav.Link href="http://localhost:3000/s/rental">Rent</Nav.Link>
            </Nav>
            <Button variant="danger" href="http://127.0.0.1:8000/login/">Log in now</Button>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Container className="mt-4">
        <h1 className="text-center">Vehicle List For Rent</h1>
        <Row>
          {rentals.map((rental) => (
            <ProductSummary key={rental.id} rental={rental} />
          ))}
        </Row>
      </Container>
    </div>
  );
}

export default VisitRent;
